import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import { fetchQuestion, updateScore } from "../services/apiService";
import { toast } from "react-toastify";
import { Home } from "lucide-react"; // ✅ Correct Import
import "../styles/Game.css";

const Game = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const level = location.state?.level || "Easy";

  // ✅ Define initial time based on level
  const getInitialTime = (level) => {
    switch (level) {
      case "Easy":
        return 30;
      case "Medium":
        return 20;
      case "Hard":
        return 10;
      default:
        return 20;
    }
  };

  // ✅ State Variables
  const [question, setQuestion] = useState("");
  const [answer, setAnswer] = useState("");
  const [userInput, setUserInput] = useState("");
  const [feedback, setFeedback] = useState("");
  const [score, setScore] = useState(0);
  const [timeLeft, setTimeLeft] = useState(getInitialTime(level));

  useEffect(() => {
    // ✅ Redirect to login if user is not authenticated
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login");
    }
  }, [navigate]);

  useEffect(() => {
    fetchNewQuestion(); // ✅ Fetch a question when component loads

    // ✅ Timer Setup
    const timer = setInterval(() => {
      setTimeLeft((prevTime) => {
        if (prevTime <= 1) {
          clearInterval(timer);
          toast.warn("Time's up! ⏰", { autoClose: 2000 });
          return 0;
        }
        return prevTime - 1;
      });
    }, 1000);

    return () => clearInterval(timer); // ✅ Cleanup on unmount
  }, []);

  // ✅ Fetch Question using API Service
  const fetchNewQuestion = async () => {
    try {
      const data = await fetchQuestion();
      setQuestion(data.question);
      setAnswer(data.solution);
    } catch (error) {
      console.error("Error fetching question", error);
      toast.error("Failed to load question");
    }
  };

  // ✅ Handle Answer Submission
  const handleSubmit = async () => {
    if (parseFloat(userInput) === parseFloat(answer)) {
      setScore((prevScore) => prevScore + 10);
      setFeedback("Correct! 🎉");
      toast.success("Correct Answer! +10 Points");

      try {
        await updateScore(10);
      } catch (error) {
        console.error("Error updating score", error);
      }
    } else {
      setFeedback("Wrong ❌");
      toast.error("Incorrect Answer");
    }

    setUserInput("");
    fetchNewQuestion();
  };

  return (
    <div className="Gbody">
      <div className="GameContainer">
        <div className="overlayG">
          {/* ✅ Main Menu Button */}
          <button
            className="mainmenu-icon"
            style={{
              position: "absolute",
              top: "20px",
              right: "50px",
              cursor: "pointer",
              background: "orange",
              borderRadius: "50%",
              padding: "10px",
            }}
            onClick={() => navigate("/dashboard")}
          >
            <Home size={30} color="white" />
          </button>

          <div className="game-container">
            <div className="score-timer-container">
              <div className="score-block">Score: {score}</div>
              <div className="timer-block">Time Left: {timeLeft}s</div>
            </div>

            {/* ✅ Display Question Image */}
            <div className="question-container">
              {question && <img src={question} alt="Math Puzzle" className="question-image" />}
            </div>

            {/* ✅ Number Input */}
            <input
              type="text"
              className="answer-input"
              value={userInput}
              onChange={(e) => setUserInput(e.target.value)}
              placeholder="Enter your answer"
            />

            {/* ✅ Submit Button */}
            <button onClick={handleSubmit} className="submit-button" disabled={userInput === ""}>
              Submit
            </button>

            {/* ✅ Feedback Message */}
            <p className="feedback">{feedback}</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Game;
